import images from "../Assets/images.jpg"

const Home = () => {

    return (

        <div class="flex flex-col">
       <div class="bg-blue-500 bg-opacity-100"></div>
       <div class="bg-black-500 bg-opacity-100"></div>
       <div class="bg-blu-500 bg-opacity-100"></div>
      </div>
    );
}

export default Home;
